image by scott heins/gothamist.

we are living in a very difficult time, it's just the begging of something that will affect all of us but i see that people still sleeping, still doing nothing about this to stop it. we are now in the middle of the government shutdown, a government leading by someone who think that he is the star of a movie and the whole country/world is the film stage. there is 800,000 plus people ( employees and affected people ) with no clue of how they gonna survive with no money, just because this con man, like a spoiled baby, want something with no value just to show the world that he always get what he wants. if these people want to see a change and want to survive and keep their homes, cars, and keep paying those bills they need to make their voice heard, and loud. let's go to washington mall in a pacific protest until this spoiled child see that the nations are based on people not on morrons, not on bigotry and that the only interest that matters are the interest of the people that every day wake up with the hope of be a better person, a better citizen. let's fill the streets of every city and don't stop until the government open again and until this con man sign the raise of every federal employee wages. stop playing games and go home and play the exact game with your family. let this nation in peace!!! (sorry for the misspelling)

